import React from 'react';
import './App.css';

function App() {

  const subreddit = "memes"
  const heads = new Headers();
  const url = `https://www.reddit.com/r/${subreddit}/top.json?limit=10`;
  const url1 = `https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=code&state=alskdjfhg&redirect_uri=http://localhost:3000&duration=permanent&scope=identity`;
  const url2 = `https://www.reddit.com/api/search_reddit_names?exact=false&include_over_18=true&include_unadvertisable=true&query=Tech`;

  heads.append("Access-Control-Allow-Origin", "true");

  window.fetch(url1, {
    headers: {
      'Access-Control-Allow-Credentials': true,
    },
    method: 'POST',
    mode: 'cors',
    redirect: 'follow',
    credentials: 'include',
  })
  .then((response) => {
    console.log(response);
  })
  .catch((error) => {
    console.log('Error: ' + error);
  })


  return (
    <div className="App">
      <p>{url1}</p>
    </div>
  );
}

export default App;
